var toggleChartsPaneButton=L.easyButton({id:"toggleChartsPaneButton",states:[{stateName:"show-charts-pane",icon:'<img src="data:image/png;base64,">',
title:"Show Elevation",onClick:function(a,b){jscallback.toggleChartsPane(!0);a.state("hide-charts-pane")}},{stateName:"hide-charts-pane",icon:'<span class="cross">&cross;</span>',title:"Hide Elevation",onClick:function(a,b){jscallback.toggleChartsPane(!1);a.state("show-charts-pane")}}]});toggleChartsPaneButton.addTo(myMap);
function setChartsPaneButtonState(a){"ON"==a.toUpperCase()?toggleChartsPaneButton.state("hide-charts-pane"):"OFF"==a.toUpperCase()&&toggleChartsPaneButton.state("show-charts-pane")};